import React from 'react';

const Menu = () => {
    return (
        <div className="col-md-6 d-none d-md-block">
            <ul className="menu">
                <li>
                    <a href="">Home</a>
                </li>
                <li>
                    <a href="">Explore</a>
                </li>
                <li>
                    <a href="">Bookmarks</a>
                </li>
            </ul>                 
        </div>
    );
};

export default Menu;
